import React, { useState } from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import MenuItem from '@mui/material/MenuItem';
import IconButton from '@mui/material/IconButton';
import { Box, FormControl, InputLabel, Select } from '@mui/material';
import { useNavigate } from 'react-router-dom';


const ResponsiveAppBar = () => {
    const [anchorEl, setAnchorEl] = useState(null);
    const [section, setSection] = useState('all');
     const navigate = useNavigate();

    const handleMenu = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };

     const handleLogout = () => {
        // Remove the token from local storage
        localStorage.removeItem('token');
        console.log('Logout');


        navigate('/');


    };

    const handleSectionChange = (event) => {
        console.log('Section changed to:', event.target.value);
        setSection(event.target.value);
    };

    return (
        <Box sx={{ backgroundColor: '#EE8832' }}>

                <Typography variant="h6" component="div" sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' }, color: 'white' }}>
                    Voter Data
                </Typography>

                <Button 
                    color="inherit"
                    onClick={handleLogout}
                    variant="outlined"
                    sx={{ borderColor: 'white', marginLeft: 2, color: 'white', minWidth: 200, marginRight: 2 }}
                >
                    Logout
                </Button>


        </Box>
    );
};

export default ResponsiveAppBar;
